    const first10 = fakeData.slice(0,10)
    const [products, setProducts] = useState(first10);  
    return (
        <div className="shop-container">
        <div className="product-container">
        
            {
                products.map(product => <Product></Product>)
            }
  
        </div>
        <div className="cart-container">
            <h3>this is cart</h3>
        </div>
            

        </div>
    );
};

export default Shop;
